
DROP TABLE photos CASCADE;
DROP TABLE amenagement_par_devis CASCADE;
DROP TABLE utilisateurs CASCADE;
DROP TABLE devis;
DROP TABLE clients;
DROP TABLE types_amenagements ;


CREATE TABLE types_amenagements(
	id_amenagement SERIAL PRIMARY KEY,
	nom VARCHAR(50) NOT NULL
);
CREATE TABLE clients (
	id_client SERIAL PRIMARY KEY ,
	nom CHARACTER VARYING (50)NOT NULL,
	prenom CHARACTER VARYING (50)NOT NULL,
	ville CHARACTER VARYING (50)NOT NULL,
	code_postal INTEGER NOT NULL,
	rue CHARACTER VARYING(50) NOT NULL,
	numero INTEGER NOT NULL,
	boite VARCHAR(16),
	telephone VARCHAR(16) NOT NULL,
	email CHARACTER VARYING (50) NOT NULL
);

CREATE TABLE devis (
	id_devis SERIAL PRIMARY KEY,
	id_client INTEGER references clients(id_client) NOT NULL,
	date_devis DATE NOT NULL,
	montant_total FLOAT NOT NULL,
	duree_travaux INTEGER NOT NULL,
	etat_des_amenagements CHARACTER VARYING (4),
	date_debut_des_travaux DATE,
	visibilite_amenagement BOOLEAN
);
CREATE TABLE photos(
	id_photo SERIAL PRIMARY KEY,
	id_amenagement INTEGER references types_amenagements(id_amenagement) NOT NULL,
	id_devis INTEGER references devis(id_devis)NOT NULL,
	visibilite BOOLEAN NOT NULL,
	date_photo DATE NOT NULL,
	url_photo TEXT

);



CREATE TABLE amenagement_par_devis(
	id_devis INTEGER REFERENCES devis(id_devis),
	id_amenagement INTEGER REFERENCES types_amenagements(id_amenagement),
	PRIMARY KEY(id_devis,id_amenagement)
);


CREATE TABLE utilisateurs (
	id_utilisateur SERIAL PRIMARY KEY,
	nom CHARACTER VARYING (50)NOT NULL,
	prenom CHARACTER VARYING (50)NOT NULL,
	ville CHARACTER VARYING (50)NOT NULL,
	email CHARACTER VARYING (50)NOT NULL,
	pseudo CHARACTER VARYING (50)NOT NULL,
	mot_de_passe CHARACTER VARYING(100)NOT NULL,
	type CHAR (1) ,
	id_client INTEGER references clients(id_client),
	confirmation_inscription BOOLEAN NOT NULL,
	date_inscription TIMESTAMP NOT NULL
);

ALTER TABLE devis ADD photo_prefere INTEGER references photos(id_photo);

